INSERT INTO `pins` VALUES (1,3886920,204032,546874,1215856,'0','ent.pengpeng.com','http://ent.pengpeng.com/201202/9698.html#p=4','萧敬腾带病现身签唱会 唱凤飞飞老歌显不舍_明星图集_碰碰明星网','',2626181,117355,2626181,1334331558,0,0,0,0,''),(2,3886919,181793,546720,990979,'0','duitang.com','http://www.duitang.com/people/mblog/11375463/detail/','浪漫的羽毛和花卉','',2085761,121060,2085761,1334331557,0,0,0,0,''),(3,3886918,211169,546971,1234940,'0','topit.me','http://www.topit.me/album/892987/item/7281680','葡萄风信子 爱','',3761147,40203,2673699,1334331556,0,0,0,0,''),(4,3886917,120858,348196,1679748,'0','dribbble.com','http://dribbble.com/shots/511706-Call-the-UFO?list=popular&amp;offset=348','callufo','',3787504,18061,3776751,1334331557,0,0,0,0,''),(5,3886915,204032,546874,1215859,'0','ent.pengpeng.com','http://ent.pengpeng.com/201202/9698.html#p=6','萧敬腾带病现身签唱会 唱凤飞飞老歌显不舍_明星图集_碰碰明星网','',2626190,117355,2626190,1334331552,0,0,0,0,''),(6,3886914,211182,546945,1175733,'0','ecook.cn','http://ecook.cn/ecook/viewContent.shtml?id=23576','翡翠虾仁-网上厨房\\n基尾虾洗净去壳，挑去虾线，放碗中用水淀粉抓匀上浆；\\n菠菜择洗干净，放入搅拌机中，打成菠菜汁备用；姜切末、葱切碎。\\n锅中油烧至六成热，下入虾仁滑炒1分钟，捞出沥油待用；\\n锅中留少许底油烧热，放入葱花、姜末炒香；\\n再加入清汤、菠菜汁，加入盐、胡椒粉烧开，然后撇去浮沫，加入虾仁烧至入味，最后用水淀粉勾芡，淋入明油即可。','',3660058,100368,3660058,1334331551,0,0,0,0,''),(7,3886913,120858,348196,1693248,'0','uisheji.com','http://www.uisheji.com/106060.html/2','qq桌面图标和ui界面设计','',3813546,18061,3813546,1334331551,0,0,0,0,''),(8,3886912,132765,546924,1580650,'0','duitang.com','http://www.duitang.com/people/mblog/23288303/detail/','2012年到现在看到的最喜欢的一部电影 推荐给看到的你。','',3516006,58788,3516006,1334331552,0,0,0,0,''),(9,3886911,76689,546972,814778,'0','','','小哥','',3886739,44514,1635245,1334331551,0,0,0,0,''),(10,3886910,120137,358893,311351,'0','weibo.com','http://weibo.com/1671526850/xFF883JUE','哇。。阳光暖暖的，好惬意的。','',3717921,110823,552624,1334331551,0,0,0,0,'http://ww2.sinaimg.cn/bmiddle/84fe43edjw1dot0p6fv9lj.jpg'),(11,3886909,160479,453257,145538,'0','markzhi.com','http://markzhi.com/mark/178983','flickr.com - 美食','',3886670,209021,234296,1334331549,0,0,0,0,'http://pic.yupoo.com/ucdcn_v/Bz1SLxiP/wood.jpg'),(12,3886907,120858,348196,1705351,'0','dribbble.com','http://dribbble.com/shots/496215-Scan-iPad-App-/attachments/33489','Dribbble - scan.png by Oykun Yilmaz','',3845095,18061,3845095,1334331548,0,0,0,0,''),(13,3886904,211182,546945,817037,'0','ecook.cn','http://ecook.cn/ecook/viewContent.shtml?id=93373','芒果大福-网上厨房\\n蛋黄加入白糖搅拌均匀，隔温水打到颜色变浅，白糖溶解。\\n加入低粉，搅拌均匀。\\n分次加入牛奶，边小火加热，边搅拌！直到很粘稠，很顺滑，稍凉后，将做好的卡仕达酱入冰箱冷藏备用。\\n糯米粉加澄粉少许色拉油混合。\\n倒入牛奶调成像酸奶一样的糊，微波3分钟左右，拿出搅拌成面团。如果没有成团，可再加1分钟，观察情况。晾凉后，揉成面团备用。\\n芒果切成小块。\\n隔保鲜膜取一块卡仕达酱，在中间加一块芒果。\\n用保鲜膜握紧包好；入冰箱冷冻1小时左右。为了定型，这样一会儿才好包。\\n取一块外皮，隔一次性手套，按扁，放入','',3660100,100368,3660100,1334331547,0,0,0,0,''),(14,3886902,93769,289591,543913,'0','weibo.com','http://weibo.com/2464583360/y4q8SEaMU','','',1822938,81638,1027658,1334331545,0,0,0,0,'http://ww3.sinaimg.cn/bmiddle/92e68ec0jw1dptzyz40d3j.jpg'),(15,3886901,125996,535281,886986,'0','xinxisheji.tuyansuo.com','http://xinxisheji.tuyansuo.com/info/1258.html','人人网用户消费力','',3291638,46161,1849738,1334331544,1,0,0,0,''),(16,3886900,210223,544749,1560671,'0','ruineshumaines.tumblr.com','http://ruineshumaines.tumblr.com/post/20556523144','Rio Jarama by *ELENADUDINA','',3728552,153687,3456035,1334331544,0,0,0,0,''),(17,3886899,120858,348196,1608959,'0','365awesomedesigners.com','http://365awesomedesigners.com/','','',3859532,18061,3859532,1334331540,0,0,0,0,''),(18,3886897,169963,477095,623774,'0','weibo.com','http://weibo.com/1931401054/y5pQE0IPg','礼物包装，快来学写吧~~&gt;&gt;&gt;更多有趣内容，请关注@美好创意DIY','',1656954,106575,1206748,1334331538,0,0,0,0,''),(19,3886896,171411,479832,651375,'0','ww1.sinaimg.cn','http://ww1.sinaimg.cn/large/61e61e8cjw1dq55pg04a0j.jpg','电子商务网站 导航栏对比~~','',3886708,135332,1268884,1334331537,0,0,0,0,''),(20,3886893,132765,546924,222057,'0','duitang.com','http://www.duitang.com/people/mblog/24141720/detail/','%E3%80%8A%E7%99%BD%E5%85%94%E7%B3%96%20%E3%81%86%E3%81%95%E3%81%8E%E3%83%89%E3%83%AD%E3%83%83%E3%83%97%20(2011)%E3%80%8B%E5%AF%BC%E6%BC%94%3A%20%E8%90%A8%E5%B8%83%20%E7%9C%8B%E7%99%BD%E5%85%94%E7%B3%96%E7%9A%84%E6%84%9F%E8%A7%89%E5%83%8F%E5%B0%8F%E6%97%B6','',3589690,58788,3589690,1334331535,0,0,0,0,''),(21,3886970,118157,351820,607179,'0','wenku.baidu.com','http://wenku.baidu.com/view/85020cf27c1cfad6195fa7ea.html','#花瓣小百科#别告诉我你会用WORD 据说，80%以上的人看了这个，都相见恨晚，你会么？不管你信不信，反正我是信了。[爱你]','',3469181,86804,1172147,1334331593,0,0,0,0,''),(22,3886968,211182,546945,1549320,'0','ecook.cn','http://ecook.cn/ecook/viewContent.shtml?id=176501','卡布基诺咖啡-网上厨房\\n咖啡豆磨成粉；\\n用咖啡机自带的量勺将咖啡粉加入滤勺中，约一勺半45克左右；\\n从咖啡机顶部注入清水，将杯子接在滤嘴下，旋钮调到煮咖啡的工作档，约一分钟后，煮好的咖啡就会从滤嘴中流出；\\n将煮好的咖啡转入深口杯子中，加入两勺糖搅拌均匀；\\n另取一杯，将50ML冰牛奶倒入杯中，咖啡机中注入清水（份量外），调到蒸汽档，将滤杯拿走，将蒸汽嘴调到中间，等到有蒸汽从孔中喷出时，将牛奶杯拿起，让蒸汽嘴没入牛奶中，利用高温高压将牛奶迅速打成奶泡，在牛奶加温到60度左右时迅速关掉蒸汽，以免过热后消泡；\\n将','',3427847,100368,3427847,1334331592,0,0,0,0,''),(23,3886966,211203,546974,556838,'0','abcdemtone.diandian.com','http://abcdemtone.diandian.com/post/2012-02-09/15418345','两小无嫌猜','',3876142,175925,1059397,1334331592,0,0,0,0,'http://m1.img.libdd.com/farm3/35/A719B373C978A6AA9A3CCAC56B47F523_500_567.jpg'),(24,3886962,120858,348196,19095,'0','bbs.blueidea.com','http://bbs.blueidea.com/thread-3004493-1-1.html','推荐作品-差异化的质感设计 - Powered by Discuz!','',3407295,18061,23560,1334331585,0,0,0,0,'http://pinnawhite.com/weblog/uploads/2010/04/b-energy-manager-1-tm.jpg'),(25,3886961,211182,546945,1569649,'0','ecook.cn','http://ecook.cn/ecook/viewContent.shtml?id=76492','韭菜墨鱼仔-网上厨房\\n用食指和大拇指紧紧捏住墨鱼仔须子下部，用力挤压；\\n将中间的小黑点揪出，再用剪刀剪开墨鱼仔的眼睛；\\n先将里面的黑色汁液挤出，彻底冲洗干净；\\n韭菜择洗干净后且成5厘米长的段，大蒜切片，彩椒切5厘米长的条；\\n煮锅中倒入清水，大火煮开后，将墨鱼仔放在笊篱里，在开水中烫3秒钟捞出；\\n锅中倒入油，放入大蒜片爆香，倒入韭菜，墨鱼仔，淋入料酒，加盐，胡椒粉，香醋，淋入水淀粉，最后倒入彩椒；\\n这一过程，要在10秒钟内完成，否则墨鱼就老了，口感不好。','',3484823,100368,3484823,1334331586,0,0,0,0,''),(26,3886960,77305,284319,1701232,'0','ecook.cn','http://ecook.cn/ecook/viewContent.shtml?id=91406','水煮牛肉片-网上厨房\\n牛肉片化冻，葱、姜、蒜切片，郫县豆瓣酱切碎一些\\n娃娃菜洗净后，焯烫一下捞出放入容器中\\n锅烧热倒入油，先下花椒慢炸约2分钟，倒入干辣椒和豆瓣酱，炒出香味\\n将蒜片和姜倒入锅中，炒出香味，加入热水\\n水沸腾后，将牛肉片倒入，用筷子拨散\\n煮至牛肉片彻底变色，再继续加热片刻，捞出表面的浮油倒掉\\n根据口味调入少许盐调匀出锅，倒入装娃娃菜的容器中即可','',3864656,111387,3834971,1334331584,0,0,0,0,''),(27,3886959,211169,546971,370136,'0','topit.me','http://www.topit.me/album/49041/item/181498','向日葵 格桑花 不知名小花、阁楼、盈月阁','',3317754,40203,3317754,1334331584,0,0,0,0,''),(28,3886955,132165,392069,1681797,'0','tu6.cn','http://www.tu6.cn/shouji/480x640/2963.html','Sometimes, you have to get knocked down lower than you have ever been to stand back up taller than you ever were. 有时候，你必须跌到你从未经历的谷底，才能再次站在你从未到达的高峰。','',3781616,77548,3781616,1334331581,0,0,0,0,''),(29,3886953,82872,362991,1452619,'0','luoli.co','http://www.luoli.co/keailuoli/203.html',' ','',3885006,93769,3190453,1334331579,0,0,0,0,''),(30,3886952,208319,539122,1706206,'0','adtaste.pceggs.com','http://adtaste.pceggs.com/TY/yy365.aspx','注册YY365，每日拿金蛋！','',3886790,208319,3886790,1334331580,0,0,0,0,''),(31,3886944,120858,348196,483599,'0','dribbble.com','http://dribbble.com/shots/408190-Quick-Setting-Toggles?list=popular&amp;offset=0','Quick_settings','',3407557,18061,886508,1334331574,0,0,0,0,'http://dribbble.com/system/users/4531/screenshots/408190/quick_settings.png?1328110230'),(32,3886942,210223,544749,1607854,'0','weibo.com','http://weibo.com/2131445654/ydNGl6u2d','【巴黎蒙马特】连楼梯也梦幻~','',3727450,153687,3587197,1334331573,0,0,0,0,''),(33,3886938,160479,509204,551363,'0','duitang.com','http://www.duitang.com/album/321977/?from=detail_right#albumpics','有点披萨的感觉哦！','',3886589,209021,1046310,1334331570,0,0,0,0,'http://cdn.duitang.com/uploads/item/201202/01/20120201235817_tPxz8.thumb.200_0.jpg'),(34,3886934,211182,546945,1630716,'0','ecook.cn','http://ecook.cn/ecook/viewContent.shtml?id=114290','玫瑰糖 -网上厨房\\n红玫瑰三朵；\\n将花瓣一片片扯下来，泡在水里清洗干净；\\n然后用纸巾将花瓣上的水蘸干，注意一定要完全蘸干哦，不然制成糖酱后不易贮存，很容易坏；\\n取一干净的大碗，碗里不能有水，将弄干的玫瑰花瓣倒入，然后加入四倍于花瓣份量的白糖，用擀面杖捣烂；\\n将捣好的糖装入密封玻璃罐中，盖严实盖子，放入冰箱贮藏7-15天即可。','',3642550,100368,3642550,1334331567,0,0,0,0,''),(35,3886932,132165,392319,1682622,'0','warting.com','http://www.warting.com/gallery/201110/35894_5.html','Christin Gilbert摄影作品'