34331626,0,0,0,0,''),(54,3886991,210223,546230,1661259,'0','tukeq.diandian.com','http://tukeq.diandian.com/post/2012-04-11/19712433','放在一边的风车~\\n\\n希望小学的孩子，假期编织花环，只为分担家庭的重担~\\n\\n\\n\\n\\n调皮~\\n\\n行者 匆匆~\\n\\n两小无猜~\\n\\n\\n姜糖制作\\n\\n宁静的村落，总有一抹艳丽在角落等着你~~\\n\\n感谢Bu\\\'s memory的投稿 :)','',3721167,124044,3721167,1334331617,0,0,0,0,''),(55,3886990,77305,284319,1713318,'0','ecook.cn','http://ecook.cn/ecook/viewContent.shtml?id=81425','千丝万缕虾-网上厨房\\n虾去皮、去虾线、洗净。\\n用料酒和盐腌制10分钟。\\n将粉丝泡软，在沸水中焯烫至七分熟。\\n将虾虾裹上蛋清和生粉。\\n一次裹上粉丝。\\n油温八成热，中小火，轻轻放入虾虾，炸至金黄即可，蘸酱趁热吃哈。','',3863862,111387,3861466,1334331618,0,0,0,0,''),(56,3886985,169963,477095,818319,'0','duitang.com','http://www.duitang.com/people/mblog/13221250/detail/','自己动手做书签的感觉，很美妙~~','',1656203,106575,1643623,1334331612,0,0,0,0,''),(57,3886982,77305,284319,1699718,'0','ecook.cn','http://ecook.cn/ecook/viewContent.shtml?id=92141','自制酸奶-网上厨房\\n准备白糖，可不加，不加的话比较酸。\\n把牛奶倒入奶锅内，并加入白糖煮开。\\n然后将煮开的牛奶放凉至不烫手后倒入酸奶。\\n倒入酸奶后，搅拌均匀。\\n装入开水烫过并且无油无水的密封瓶中。\\n放入电饭煲内，启动酸奶功能。\\n8小时候浓稠的酸奶就做好了。','',3864651,111387,3831305,1334331606,0,0,0,0,''),(58,3886980,93769,289591,758072,'0','weibo.com','http://weibo.com/54iphonegirl','','',1755610,81638,1508506,1334331602,0,0,0,0,''),(59,3886978,169963,477095,819401,'0','duitang.com','http://www.duitang.com/people/mblog/19216831/detail/','仿真花，布料，丝带。。。集合了各种各样素材，充满复古感的手作兔子项链','',1656637,106575,1646141,1334331603,0,0,0,0,''),(60,3886977,210223,546230,1661269,'0','tukeq.diandian.com','http://tukeq.diandian.com/post/2012-04-11/19712433','放在一边的风车~\\n\\n希望小学的孩子，假期编织花环，只为分担家庭的重担~\\n\\n\\n\\n\\n调皮~\\n\\n行者 匆匆~\\n\\n两小无猜~\\n\\n\\n姜糖制作\\n\\n宁静的村落，总有一抹艳丽在角落等着你~~\\n\\n感谢Bu\\\'s memory的投稿 :)','',3721200,124044,3721200,1334331602,0,0,0,0,''),(61,3887078,201828,546996,1705403,'0','ecook.cn','http://ecook.cn/ecook/viewContent.shtml?id=84388','果汁雪糕-网上厨房\\n先把雪糕机身放入冰箱冷冻24小时。\\n插入冰糕棒，倒入鲜榨的橙汁、草莓汁和牛奶。\\n耐心等待7-9分钟。\\n取出雪糕，就可以吃到甜美的自制果汁雪糕了。','',3845194,100368,3845194,1334331709,0,0,0,0,''),(62,3887073,132765,546991,1705347,'0','vikilife.com','http